
public class ArraySample {
	static int iot;
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int uc=11;
		int[] jumsu;
		jumsu = new int[5];

		for(int i=0; i < 5; i++) {
			System.out.println(jumsu[i]);
		}
		System.out.println(uc);
		System.out.println(iot);
	}

}
